import { Box } from '@mui/material';
import React from 'react';
import {FormControl,TextField} from '@mui/material';

export default function SignupComponent() {
  return (
    <Box>
        <FormControl>
            <TextField label="User Name"></TextField>
        </FormControl>
    </Box>
  )
}
